(21231, 'ADE3FCEB-A7BE-455C-A0C7-16E3F540B291', 'IÔ∏è don‚Äôt know how you are feeling right now, but IÔ∏è‚Äôm spinning in a downward cycle. IÔ∏è have mean thoughts and snarky things IÔ∏è want to say. IÔ∏è‚Äôm sure you‚Äôre not feeling too hot about me either. Instead of writing a hostile note, IÔ∏è‚Äôm just sharing that IÔ∏è‚Äôm not doing great right now. IÔ∏è feel like IÔ∏è have to state a scope of work that needs constant approval from you and unless IÔ∏è do that over and over again, there‚Äôs no other discussion that is warranted. And IÔ∏è feel like IÔ∏è have a gun to my head. Both of those things are not great conditions for doing non defensive work. IÔ∏è felt like we got really far this weekend and IÔ∏è felt disarmed. And now IÔ∏è just feel like my defenses are back up again. IÔ∏è‚Äôm trying hard to push through them because IÔ∏è know IÔ∏è have work to do and IÔ∏è‚Äôm not trying to create distractions for myself. But IÔ∏è feel terrible inside. And instead of taking it out on you and being mean, IÔ∏è am just telling you what‚Äôs happening in my throat and my body.', 'Nitzan', 'David', '2021-02-10T08:54:37.346215'),
(21232, '89EDD5F4-A4BC-422F-9585-2C3B7D54FC87', 'Thank you for sharing how you are feeling and not lashing out. I want to give you a hug and help you relax. I‚Äôm not feeling great either and there is more we can unpack with Priscilla tomorrow. This is hard and exhausting and sometime frustrating work. And through it...there are going to be times when we don‚Äôt see eye to eye...and that is okay. But I‚Äôm here, I love you to death and I too want to create conditions where we both feel safe to be honest and transparent with each other...we are both flawed and we can work through the hard stuff. I feel sad...but hopeful. We are going to get through this. Our bond and our love is strong. I love you my dear.', 'David', 'Nitzan', '2021-02-10T09:28:37.184622'),
