(21553, '4FAB3D2C-08DE-40E4-BBFA-9C87985FC1D0', 'Love, I‚Äôm feeling a bit tired and sad today....not sure why about the sad. I appreciate you telling me you are going to talk to Mike. I did receive it with a feeling of fear. It would have felt better to me if instead of telling me about something you had already planned, you had checked in and asked me. I know we don‚Äôt have any formal agreement here, and you didn‚Äôt do anything wrong, but I‚Äôm fighting against a negativity bias of being an afterthought. Just wanted to share. I do have further thoughts about your relationships with Mike and Joe that I‚Äôd like to share when we have time to discuss.', 'David', 'Nitzan', '2021-02-19T12:06:13.654000'),
(21554, '2DBE1190-E97C-4333-B7D1-65CA581EDCE2', 'Thanks for letting me know love. I‚Äôve also been feeling really sad this morning.', 'Nitzan', 'David', '2021-02-19T12:06:53.006570'),
(21555, '20EC63F3-57B6-4114-A216-08206FC94E30', 'IÔ∏è woke up this morning wondering about OK Cupid and just because IÔ∏è was feeling really curious, IÔ∏è logged onto my OKCupid account for the first time in months. IÔ∏è logged on to to see if you were on it and it looks like you have been this week. IÔ∏è am confused because I‚Äôm not sure what we are and aren‚Äôt saying to each other, but IÔ∏è thought you would have talked to me about it.', 'Nitzan', 'David', '2021-02-19T12:09:03.387614'),
(21556, 'F6895A3C-27F4-4462-B07C-F113846D5EB7', 'That‚Äôs why IÔ∏è brought up saying that IÔ∏è was going to talk to Mike -- because IÔ∏è wanted to be more transparent -- which is what IÔ∏è thought we were trying to do more of.', 'Nitzan', 'David', '2021-02-19T12:09:52.209484'),
