(21558, '9F9D3D91-A4A4-4586-B785-24751A77C88A', 'And IÔ∏è reached out to him this morning for the first time.', 'Nitzan', 'David', '2021-02-19T12:10:34.563020'),
(21559, '31D651B3-5CDA-4F2C-B6E9-6B66FB01AAF9', 'And if I‚Äôm being honest, IÔ∏è did that in part because IÔ∏è was feeling hurt.', 'Nitzan', 'David', '2021-02-19T12:11:01.216296'),
(21560, '6FC3B37E-3B9E-445D-B678-E6483FFB46FC', 'You are not an after thought. IÔ∏è told you about Mike within the same hour IÔ∏è reached out to him. IÔ∏è guess it‚Äôs ok to talk about it before hand too, but IÔ∏è don‚Äôt see any of this being an after thought. But sometimes, IÔ∏è feel like when you are fearful, you also make me an after thought. Like how can you be ok OK Cupid again without talking to me about it after everything that‚Äôs happened...So now I‚Äôm just really confused.', 'Nitzan', 'David', '2021-02-19T12:13:05.419750'),
(21561, '929AEF8A-5571-4929-A0AA-408E39BCC071', 'I‚Äôm not a body feeling person, but my whole body is shaking.', 'Nitzan', 'David', '2021-02-19T12:16:44.003092'),
